class Solution:
    def sortVowels(self,s: str) -> str:
        vowels_set = set('aeiouAEIOU')

        # 提取元音并排序
        vowels = sorted([ch for ch in s if ch in vowels_set])
        print(vowels)

        t = []  # 存放结果
        vowel_index = 0  # 用于按顺序取元音

        for ch in s:
            if ch in vowels_set:
                t.append(vowels[vowel_index])
                vowel_index += 1
                print(t)
            else:
                t.append(ch)  # 辅音保持原位

        return ''.join(t)




res = Solution().sortVowels(s ="")
print(res)

